import React , { Component } from "react";
import "./style.css";

class WavySvg extends Component {


    render() {

        let xs = [];

        for (var i=0; i < 500; i++) {
            xs.push(i)
        }
        console.log(xs);

        return(
            <div>
                <svg>
                    <path d="M10,10 L50,100 L90,50"></path>
                </svg>
            </div>
        )
    }
}

export default WavySvg;
